import{_ as e,c as t,o as r,a2 as a}from"./chunks/framework.aTtkxbT6.js";const s="/assets/001.CLNyUD4h.webp",o="/assets/png-gzip.pS8gDHuF.webp",p="/assets/esno.CN4cTvIV.webp",l="/assets/nue-js.1emRvQ86.webp",c="/assets/flowchart_js.DJ63wmX2.webp",n="/assets/js-sequence-diagrams.CIvhC3O4.webp",i="/assets/heatmapjs.kIvqv1rY.webp",h="/assets/cwebp.CSR3lZeR.webp",m="/assets/jsdoc.BUrWOlqY.webp",d="/assets/apidoc.D9HNq3Fw.webp",u="data:image/webp;base64,",b="/assets/spread-js.DkrmGFDp.webp",g="/assets/modern-screenshot.Bhcj-uQQ.webp",f="/assets/dom-to-image.D7OdatTm.webp",L=JSON.parse('{"title":"双周回顾#002 - 红树林","description":"","frontmatter":{"title":"双周回顾#002 - 红树林","date":"2023/10/15","desc":"第二周"},"headers":[],"relativePath":"week/002/readme.md","filePath":"week/002/readme.md"}'),w={name:"week/002/readme.md"},k=a('<p><img src="'+s+'" alt="红树林"></p><p>红树林公园，一棵单独生长在海岸边的树，下面一根根树立的幼苗，是从它的根茎上生长出来的。傍晚落潮后，会有一只只小螃蟹在这里浪荡。当然，也会有海鸟在这里进食。</p><h1 id="文档" tabindex="-1">文档 <a class="header-anchor" href="#文档" aria-label="Permalink to &quot;文档&quot;">​</a></h1><ol><li><a href="https://my.oschina.net/u/5079097/blog/5171250" target="_blank" rel="noreferrer">深入了解 Commonjs 和 Es Module</a><sup>1</sup></li></ol><p>Web 开发中，引用模块时有时使用<code>require</code>、有时使用<code>import</code>，这是基于两种不同的模块规范。本文深入讲解了<code>CommonJS</code>与<code>ESM</code>之间共性与差异性。</p><ol start="2"><li><a href="http://www.webkaka.com/blog/archives/images-no-need-to-use-gzip.html" target="_blank" rel="noreferrer">图片要启用 gzip 压缩吗？绝对不要！</a><sup>2</sup></li></ol><p><img src="'+o+'" alt="png-gzip"></p><p>通常在做 Web 性能优化时，会启用 GZIP 压缩。当使用了无损压缩的 PNG 图时，压缩后的体积会比原图体积更大，做了反优化。本文讲解了为什么为发生这种现象。</p><ol start="3"><li><a href="https://github.com/esbuild-kit/esno" target="_blank" rel="noreferrer">esno 与 tsx</a><sup>3</sup></li></ol><p><img src="'+p+'" alt="esno"></p><p>一直以为 esno 与 tsx 是两个东西，还有谁像我一样认知的呢？</p><ol start="4"><li><a href="https://nuejs.org/docs/nuejs/" target="_blank" rel="noreferrer">Nue JS</a><sup>4</sup></li></ol><p><img src="'+l+'" alt="nue-js"></p><p>随着生态的发展，三大主流 Web 框架的功能特性越来越多，源码体积也越来越大。但是有时新建一个小工程时，你并不需要那么复杂的生态，可以尝试下<code>NueJS</code>（2.3 kb）。</p><p>NueJS 是一个非常小（2.3kb minzipped）的 JavaScript 库，用于构建用户界面。它是 Nue 工具集的核心。它就像 Vue.js、React.js 或 Svelte，但没有钩子、效果、道具、门户、观察者、注入、暂停或其他不寻常的抽象。学习 HTML、CSS 和 JavaScript 的基础知识，就可以开始了。</p><h1 id="工具" tabindex="-1">工具 <a class="header-anchor" href="#工具" aria-label="Permalink to &quot;工具&quot;">​</a></h1><ol start="5"><li><a href="http://flowchart.js.org/" target="_blank" rel="noreferrer">流程图</a><sup>5</sup></li></ol><p><img src="'+c+'" alt="flowchart_js"></p><p>绘制流程图时，通常会使用阿里的 G6 等图标库，大且繁琐。当需求简单时，可以考虑换一个轻量级的库了。<code>flowchart.js</code> 压缩文件仅 70KB ，支持常规的流程图功能。</p><ol start="6"><li><a href="https://bramp.github.io/js-sequence-diagrams/" target="_blank" rel="noreferrer">时序图</a><sup>6</sup></li></ol><p><img src="'+n+'" alt="时序图"></p><p>一个简单的 javascript 库，用于将文本转换为矢量 UML 序列图。使用<code>Jison</code>来解析文本，使用 Snap.svg 来绘制图像。</p><ol start="7"><li><a href="https://www.patrick-wied.at/static/heatmapjs/" target="_blank" rel="noreferrer">热力图 - heatmap.js</a><sup>7</sup></li></ol><p><img src="'+i+'" alt="heatmapjs"></p><p>一个有趣的 JavaScript 库，在你的站点上生产一个透明背景的热力图，展示用户在站点的操作痕迹。</p><ol start="8"><li><a href="https://developers.google.com/speed/webp/download?hl=zh-cn" target="_blank" rel="noreferrer">图片转 webp</a><sup>8</sup></li></ol><p><img src="'+h+'" alt="cwebp"></p><p>在线的图片转<code>webp</code>的工具，质量参差不齐，何不尝试在 Chrome 推荐的本地工具呢。支持 Windows 版、Linux (aarch64)、Linux (x86-64)、macOS (arm64)、macOS (x86-64)</p><ol start="9"><li><a href="https://www.jsdoc.com.cn/" target="_blank" rel="noreferrer">JSDoc</a><sup>9</sup></li></ol><p><img src="'+m+'" alt="jsdoc"></p><p>JSDoc 3 是一个用于 JavaScript 的 API 文档生成器，类似于 Javadoc 或 phpDocumentor。可以将文档注释直接添加到源代码中。JSDoc 工具将扫描您的源代码并为您生成一个 HTML 文档网站。</p><ol start="10"><li><a href="https://apidocjs.com/" target="_blank" rel="noreferrer">apidoc</a><sup>10</sup></li></ol><p><img src="'+d+'" alt="apidoc"></p><ol start="11"><li><a href="https://dream-num.github.io/LuckysheetDocs/zh/guide/" target="_blank" rel="noreferrer">表格-Luckysheet</a><sup>11</sup></li></ol><p><img src="'+u+'" alt="luckysheet"></p><p>Luckysheet ，一款纯前端类似 excel 的在线表格，功能强大、配置简单、完全开源。支持格式设置、单元格配置、行和列操作、图标、公式和函数等。</p><ol start="12"><li><a href="https://www.grapecity.com.cn/developer/spreadjs/demo" target="_blank" rel="noreferrer">表格-SpreadJS</a><sup>12</sup></li></ol><p><img src="'+b+'" alt="spread-js"></p><p>商用的表格，业务场景比较复杂时，可以考虑下这家的表格组件。</p><ol start="13"><li><a href="https://github.com/qq15725/modern-screenshot" target="_blank" rel="noreferrer">Web 页面截图</a><sup>13</sup></li></ol><p><img src="'+g+'" alt="Web 页面截图之 modern-screenshot"></p><p>使用 HTML5 或者 SVG 快速将页面 DOM 节点转化为图片.</p><ol start="14"><li><a href="https://github.com/tsayen/dom-to-image" target="_blank" rel="noreferrer">Web 页面截图之 dom-to-image</a><sup>14</sup></li></ol><p><img src="'+f+'" alt="dom-to-image"></p><p><code>dom-to-image</code> 是一个库，可以将任意 dom 节点转换为用 JavaScript 编写的矢量（SVG）或光栅（PNG 或 JPEG）图像。</p><h1 id="references" tabindex="-1">References <a class="header-anchor" href="#references" aria-label="Permalink to &quot;References&quot;">​</a></h1><ul><li>[^1] 深入了解 Commonjs 和 Es Module <a href="https://my.oschina.net/u/5079097/blog/5171250" target="_blank" rel="noreferrer">https://my.oschina.net/u/5079097/blog/5171250</a></li><li>[^2] 图片要启用 gzip 压缩吗？绝对不要！ <a href="http://www.webkaka.com/blog/archives/images-no-need-to-use-gzip.html" target="_blank" rel="noreferrer">http://www.webkaka.com/blog/archives/images-no-need-to-use-gzip.html</a></li><li>[^3] esno 与 tsx <a href="https://github.com/esbuild-kit/esno" target="_blank" rel="noreferrer">https://github.com/esbuild-kit/esno</a></li><li>[^4] Nue JS <a href="https://nuejs.org/docs/nuejs/" target="_blank" rel="noreferrer">https://nuejs.org/docs/nuejs/</a></li><li>[^5] 流程图 <a href="http://flowchart.js.org/" target="_blank" rel="noreferrer">http://flowchart.js.org/</a></li><li>[^6] 时序图 <a href="https://bramp.github.io/js-sequence-diagrams/" target="_blank" rel="noreferrer">https://bramp.github.io/js-sequence-diagrams/</a></li><li>[^7] 热力图 - heatmap.js <a href="https://www.patrick-wied.at/static/heatmapjs/" target="_blank" rel="noreferrer">https://www.patrick-wied.at/static/heatmapjs/</a></li><li>[^8] 图片转 webp <a href="https://developers.google.com/speed/webp/download?hl=zh-cn" target="_blank" rel="noreferrer">https://developers.google.com/speed/webp/download?hl=zh-cn</a></li><li>[^9] JSDOc <a href="https://www.jsdoc.com.cn/" target="_blank" rel="noreferrer">https://www.jsdoc.com.cn/</a></li><li>[^10] apidoc <a href="https://apidocjs.com/" target="_blank" rel="noreferrer">https://apidocjs.com/</a></li><li>[^11] 表格-Luckysheet <a href="https://dream-num.github.io/LuckysheetDocs/zh/guide/" target="_blank" rel="noreferrer">https://dream-num.github.io/LuckysheetDocs/zh/guide/</a></li><li>[^12] 表格-SpreadJS <a href="https://www.grapecity.com.cn/developer/spreadjs/demo" target="_blank" rel="noreferrer">https://www.grapecity.com.cn/developer/spreadjs/demo</a></li><li>[^13] Web 页面截图 <a href="https://github.com/qq15725/modern-screenshot" target="_blank" rel="noreferrer">https://github.com/qq15725/modern-screenshot</a></li><li>[^14] Web 页面截图之 dom-to-image <a href="https://github.com/tsayen/dom-to-image" target="_blank" rel="noreferrer">https://github.com/tsayen/dom-to-image</a></li></ul><h1 id="往期回顾" tabindex="-1">往期回顾 <a class="header-anchor" href="#往期回顾" aria-label="Permalink to &quot;往期回顾&quot;">​</a></h1><ul><li><a href="./../001/readme.html">双周回顾#001 - 火烧云</a></li></ul>',49),S=[k];function A(j,y,z,x,D,H){return r(),t("div",null,S)}const P=e(w,[["render",A]]);export{L as __pageData,P as default};
